data = msg.payload.split(",");
output={};
output["i"]         = parseInt(data[0]);
output["millis"]    = parseInt(data[1]);
output["vbat"]      = parseInt(data[2]);
output["millivolts"]= parseInt(data[3]);
output["temp"]      = parseFloat(data[4]);
output["pres"]      = parseInt(data[5]);
output["height"]    = parseFloat(data[6]);
output["ax"]        = parseFloat(data[7]);
output["ay"]        = parseFloat(data[8]);
output["az"]        = parseFloat(data[9]);
output["gx"]        = parseFloat(data[10]);
output["gy"]        = parseFloat(data[11]);
output["gz"]        = parseFloat(data[12]);
output["atot"]      = parseFloat( Math.sqrt( output["ax"]*output["ax"] + output["ay"]*output["ay"] + output["az"]*output["az"] ) );
msg.payload = output;
return msg;
